import Link from 'next/link';
import imgs from '../imgs/img';
import './header.module.css';

const Header = () => {
    return (
        <header>
            <div className="header">
                <img src={ imgs.headerLogo } />
            </div>
            <Link href="/">
                <a>Home</a>
            </Link>
            <Link href="/about">
                <a>About</a>
            </Link>
        </header>
    )
}

export default Header;
